"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[2750],{2750:e=>{e.exports=JSON.parse('{"lessonId":"B1_U81","title":"\u0423\u0440\u043e\u043a 81: Presente de subjuntivo: \u043d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u044b (2)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u044b \u0432 Presente de subjuntivo","content":[{"text":"<strong>\u0424\u043e\u0440\u043c\u044b Presente de Subjuntivo \u043e\u0431\u0440\u0430\u0437\u0443\u044e\u0442\u0441\u044f \u043e\u0442 1-\u0433\u043e \u043b\u0438\u0446\u0430 (yo) Presente de Indicativo.</strong><br><i>conozco \u2192 conozca, conozcas...<br>tengo \u2192 tenga, tengas...</i>"},{"list":["<strong>-CONOCER:</strong> conozca, conozcas, conozca, conozcamos, conozc\xe1is, conozcan<br><i>Otros: conducir, obedecer, parecer, reconocer, traducir</i>","<strong>-HUIR:</strong> huya, huyas, huya, huyamos, huy\xe1is, huyan<br><i>Otros: concluir, construir, contribuir, destruir, influir</i>","<strong>-TRAER:</strong> traiga, traigas, traiga, traigamos, traig\xe1is, traigan<br><i>Otros: caer(se)</i>","<strong>-DECIR:</strong> diga, digas, diga, digamos, dig\xe1is, digan","<strong>-HACER:</strong> haga, hagas, haga, hagamos, hag\xe1is, hagan","<strong>-O\xcdR:</strong> oiga, oigas, oiga, oigamos, oig\xe1is, oigan","<strong>-PONER:</strong> ponga, pongas, ponga, pongamos, pong\xe1is, pongan","<strong>-SALIR:</strong> salga, salgas, salga, salgamos, salg\xe1is, salgan","<strong>-TENER:</strong> tenga, tengas, tenga, tengamos, teng\xe1is, tengan","<strong>-VENIR:</strong> venga, vengas, venga, vengamos, veng\xe1is, vengan","<strong>-IR:</strong> vaya, vayas, vaya, vayamos, vay\xe1is, vayan","<strong>-SABER:</strong> sepa, sepas, sepa, sepamos, sep\xe1is, sepan","<strong>-HABER:</strong> haya"]}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435","content":[{"text":"\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438 \u0438 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f\u043c\u0438, \u0432\u044b\u0440\u0430\u0436\u0430\u044e\u0449\u0438\u043c\u0438:"},{"list":["<strong>- \u0436\u0435\u043b\u0430\u043d\u0438\u044f:</strong> <i>\xa1Ojal\xe1 no <strong>haya</strong> m\xe1s guerras!</i>","<strong>- \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u044c:</strong> <i>\u2013\xbfEst\xe1s esperando a Manuel? \u2013S\xed, pero puede que no <strong>venga</strong> hoy.</i>","<strong>- \u0447\u0443\u0432\u0441\u0442\u0432\u0430:</strong> <i>Siento que Alberto no <strong>vaya</strong> a tu concierto, pero no se encuentra bien.</i>","<strong>- \u043e\u0446\u0435\u043d\u043a\u0443 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439:</strong> <i>Es l\xf3gico que <strong>construyan</strong> m\xe1s carreteras.</i>"]}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 81.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 Presente de subjuntivo","tasks":[{"id":"u81_1_1","sentence":"1. Espero que Ana (traer) ___ algo de postre. Yo no he comprado nada.","answer":"traiga"},{"id":"u81_1_2","sentence":"2. Me encanta que \xc1lvaro (tener) ___ tantos amigos.","answer":"tenga"},{"id":"u81_1_3","sentence":"3. \u2013\xbfD\xf3nde est\xe1 Carla? \u2013Preg\xfantale a Mario. Es probable que \xe9l lo (saber) ___.","answer":"sepa"},{"id":"u81_1_4","sentence":"4. Luis y Pili quieren que (nosotros, ir) ___ de excursi\xf3n este domingo. \xbfQu\xe9 te parece?","answer":"vayamos"},{"id":"u81_1_5","sentence":"5. Yo invito. No quiero que (ustedes, decir) ___ que no lo hemos celebrado.","answer":"digan"},{"id":"u81_1_6","sentence":"6. Habla un poco m\xe1s alto. Puede que no te (o\xedr) ___.","answer":"oiga"},{"id":"u81_1_7","sentence":"7. \xa1Ojal\xe1 (hacer) ___ buen tiempo ma\xf1ana! Queremos ir al campo.","answer":"haga"},{"id":"u81_1_8","sentence":"8. No me gusta que (t\xfa, conducir) ___ tan deprisa. Me pone nerviosa.","answer":"conduzcas"},{"id":"u81_1_9","sentence":"9. B\xe1jate de ah\xed, Ra\xfal. No quiero que (t\xfa, caerse) ___.","answer":"te caigas"},{"id":"u81_1_10","sentence":"10. \u2013\xbfVais a estar en casa esta noche? \u2013No lo s\xe9. Puede que (salir) ___.","answer":"salgamos"},{"id":"u81_1_11","sentence":"11. Les voy a presentar a Mar\xeda. Quiero que la (conocer) ___.","answer":"conozcan"},{"id":"u81_1_12","sentence":"12. Siento que no (haber) ___ m\xe1s helado, pero se ha acabado.","answer":"haya"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 81.2: \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0438\u0442\u0435 \u0434\u0432\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 que","tasks":[{"id":"u81_2_1","sentence":"1. Hay pobreza en el mundo. Me parece terrible. \u2192 Me parece terrible que ___ pobreza en el mundo.","answer":"haya"},{"id":"u81_2_2","sentence":"2. Mi gato huye cuando ve a un perro. Es l\xf3gico. \u2192 Es l\xf3gico que mi gato ___ cuando ve a un perro.","answer":"huya"},{"id":"u81_2_3","sentence":"3. Antonia no dice nunca la verdad. Me parece mal. \u2192 Me parece mal que Antonia no ___ nunca la verdad.","answer":"diga"},{"id":"u81_2_4","sentence":"4. Luciano y Adolfo no saben usar un ordenador. Me parece incre\xedble. \u2192 Me parece incre\xedble que Luciano y Adolfo no ___ usar un ordenador.","answer":"sepan"},{"id":"u81_2_5","sentence":"5. Pones siempre la mesa. Me parece bien. \u2192 Me parece bien que ___ siempre la mesa.","answer":"pongas"},{"id":"u81_2_6","sentence":"6. Ten\xe9is siempre hambre; trabaj\xe1is mucho. Es natural. \u2192 Es natural que ___ siempre hambre.","answer":"teng\xe1is"},{"id":"u81_2_7","sentence":"7. Susana no hace nunca la cama. No me parece bien. \u2192 No me parece bien que Susana no ___ nunca la cama.","answer":"haga"},{"id":"u81_2_8","sentence":"8. Destruyen los bosques. Es una verg\xfcenza. \u2192 Es una verg\xfcenza que ___ los bosques.","answer":"destruyan"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 81.3: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0434\u0438\u0430\u043b\u043e\u0433\u0438 \u043f\u043e\u0434\u0445\u043e\u0434\u044f\u0449\u0438\u043c\u0438 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438","tasks":[{"id":"u81_3_1","sentence":"1. \u2013Mira esos obreros. Se van a caer. \u2013Es imposible que ___. Tienen cinturones de seguridad.","answer":"se caigan"},{"id":"u81_3_2","sentence":"2. \u2013Hay mucha gente en la exposici\xf3n. \u2013Es normal que ___ tanta gente. Es una pintora buen\xedsima.","answer":"vaya"},{"id":"u81_3_3","sentence":"3. \u2013Elsa sale con Tom\xe1s. \u2013No me gusta que ___ con ese chico. Es muy celoso.","answer":"salga"},{"id":"u81_3_4","sentence":"4. \u2013\xa1Cuidado! Te van a o\xedr. \u2013Es imposible que me ___.","answer":"oigan"},{"id":"u81_3_5","sentence":"5. \u2013\xbfCre\xe9is que os puede reconocer? \u2013S\xed, tengo miedo de que nos ___.","answer":"reconozca"},{"id":"u81_3_6","sentence":"6. \u2013Gloria es educad\xedsima. \u2013S\xed, me llama la atenci\xf3n que ___ tan educada.","answer":"sea"}]}]}')}}]);